import React from "react";
import Myheader from "./header";
import { Link } from "react-router-dom";

const MyEducation = () => {
  let formstatus = true;
  let [mobileerror, updateMobileError] = useState("");
  let [mobile, updateMobile] = useState("");

  let [emailerror, updateEmailError] = useState("");
  let [email, updateEmail] = useState("");

  let [passworderror, updatePasswordError] = useState("");
  let [password, updatePassword] = useState("");

  let [statusmsg, updateStatus] = useState("");

  let [numteneerror, updateNumtenError] = useState("");
  let [numten, updateNumten] = useState("");

  let [gendererror, updateGenderError] = useState("");
  let [twenum, updateGender] = useState("");

  let [ageerror, updateAgeError] = useState("");
  let [age, updateAge] = useState("");

  const savePersonalData = () => {
    if (numten == "") {
      formstatus = false;
      updateNumtenError("Invalid Name");
    } else {
      updateNumtenError("");
    }

    if (age == "") {
      formstatus = false;
      updateAgeError("Invalid Age");
    } else {
      updateAgeError("");
    }

    if (twenum == "") {
      formstatus = false;
      updateGenderError("Invalid Gender");
    } else {
      updateGenderError("");
    }
    if (mobile == "") {
      formstatus = false;
      updateMobileError("Invalid mobile number");
    } else {
      updateMobileError("");
    }
    if (password == "") {
      formstatus = false;
      updatePasswordError("Invalid Password");
    } else {
      updatePasswordError("");
    }
    if (email == "") {
      formstatus = false;
      updateEmailError("Invalid Email");
    } else {
      updateEmailError("");
    }

    if (formstatus == true) {
      alert("Data is Sending......");
      var url = "http://localhost:1240/personal/";
      var personalInfo = {
        "10th Marks": numten,
        "12th Marks": twenum,
        age: age,
        mobile: mobile,
        email: email,
        password: password,
      };
      var postoption = {
        headers: { "Content-Type": "application/json" },
        method: "POST",
        body: JSON.stringify(personalInfo),
      };
      fetch(url, postoption)
        .then((response) => response.json())
        .then((servRes) => {
          updateNumten("");
          updateAge("");
          updateGender("");
          updateMobile("");
          updateEmail("");
          updatePassword("");
        });
    } else {
      updateStatus("Invalid Inputs");
    }
  };
  return (
    <div className="container mt-4 p-4 rounded">
      <div className="row mt-5">
        <div className="col-lg-12">
          <h2 className="text-center text-info">My Education Details</h2>
        </div>
        <div className="col-lg-3">
          <div className=" text-primary">
            <ul className="list-group">
              <li className="list-group-item active ">Profile Setting</li>
              <Link to="/personal" className="list-group-item text-primary">
                <i className="fa fa-user"></i> Personal Details
              </Link>
              <Link to="/contact" className="list-group-item text-primary">
                <i className="fa fa-headset"></i> Contact Details
              </Link>
              <Link to="/education" className="list-group-item text-primary">
                <i className="fa fa-book"></i> Education Details
              </Link>
              <Link to="/skill" className="list-group-item text-primary">
                <i className="fa fa-desktop"></i>
                My Skills & Expeerience
              </Link>
              <Link to="/resume" className="list-group-item text-primary">
                <i className="fa fa-file"></i>My Resume
              </Link>
            </ul>
          </div>
        </div>
        <div className="col-lg-6">
          <div className="p-4 bg-white">
            <div className="row">
              <div className="col-lg-6">
                <label>10th Marks %</label>
                <input
                  type="number"
                  className="form-control"
                  onChange={(e) => updateNumten(e.target.value)}
                  value={numten}
                ></input>
              </div>
              <div className="col-lg-6">
                <label>12th Marks %</label>
                <input type="number" className="form-control"></input>
              </div>
              <div className="mb-3">
                <label>Highest Education</label>
                <input type="text" className="form-control"></input>
              </div>
            </div>
            <div className="row">
              <div className="col-lg-6">
                <label>Highest education Passing year</label>
                <input type="number" className="form-control"></input>
              </div>
              <div className="col-lg-6">
                <label>Highest Education Marks %</label>
                <input type="number" className="form-control"></input>
              </div>
            </div>
            <div className="mt-4 text-center">
              <button className="btn btn-primary ">Update Now</button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MyEducation;
